Biblioteca (do grego βιβλιοϑήκη, composto de βιβλίον, biblion - "livro", e ϑήκη theca - "depósito"), na definição tradicional do termo, é um local em que são guardados livros, documentos tridimensionais e demais publicações para o público estudar, ler e consultar estas obras. Dessa forma, os três objetivos das bibliotecas são: 
*  a guarda dos livros e demais publicações em local livre de perigo, onde não sejam roubados, incendiados e demais perigos;  
*  a conservação, que não sejam estragados porque o público manuseia constantemente as obras, ou porque os documentos ficam úmidos, quentes e ou situações similares;  
*  a organização segundo algumas regras para catalogar e arquivar as obras impressas, com intuito de que seja possível de se encontrarem de maneira imediata por meio de classificações como autor, assunto, ou diferente característica de importância. 
*  Onde se pode utlizar o computador para fins pessoais. Os profissionais que lidam com esses objetivos são os bibliotecários, com formação em biblioteconomia, curso ensinado em instituições de ensino superior. Para os visitantes, as bibliotecas têm três finalidades básicas: estudar, ler e consultar as obras. O público procurador comum das bibliotecas está buscando um estudo sobre um certo tema, de simples leitura por diversão, ou de realização de pesquisa a respeito de alguns assuntos. Por essa razão mesmo, há uma grande variedade de pessoas que visitam as bibliotecas quando se é tratado de bibliotecas generalistas. Hoje em dia, as bibliotecas não são somente guardiãs de livros, porém, da mesma forma, de dicionários, enciclopédias, monografias, manuais, documentos tridimensionais, almanaques, atlas, jornais, revistas, mapas, cartazes, manuscritos, filmes, discos, CDs, fitas, VHS, DVDs, BDs, ou bancos de dados (arquivos em PDF ou DOC), fotografias, telas e microfilmes. Revistas e jornais são classificados como material periódico, também são organizados e armazenados em uma seção da biblioteca denominada hemeroteca - espaço próprio para este tipo de material informativo. Porém, o velho conceito de "depósito de livros" foi redefinido para "ambiente físico ou virtual destinado à coleção de informações com a finalidade de auxiliar pesquisas e trabalhos escolares ou para praticar o hábito de leitura, material este seja impressos em folhas de papel ou ainda digitalizadas e armazenadas em outros tipos de materiais, tais como CD, fitas, VHS, DVD ou bancos de dados (arquivos em PDF ou DOC). A disciplina que rege o funcionamento das bibliotecas é a Biblioteconomia, onde as Leis de Ranganathan ou Cinco Leis da Biblioteconomia são os princípios fundamentais. As Bibliotecas também são denominadas CDI (centros de documentação e informação). São normativamente locais de silêncio para não interromper a leitura de terceiros. A maior biblioteca do mundo é a do Congresso dos Estados Unidos, em Washington, D.C., com 155 milhões de itens entre livros, manuscritos, jornais, revistas, mapas, vídeos e gravações de áudio. É a biblioteca oficial de pesquisa do congresso norte-americano e foi criada em 1800, quando a sede do governo federal foi transferida de Filadélfia para Washington. Seu prédio, chamado Thomas Jefferson Building, foi aberto ao público em 1897 .
